        html: '<p>No as in the new <a rel="nofollow" href="https://github.com/PanQiWei/AutoGPTQ">AutoGPTQ</a>
          - it''s the future of AutoGPTQ!  That''s what I recommend everyone use for
          GPTQ, instead of GPTQ-for-LLaMA.  It supports both Triton and CUDA, but
          CUDA is faster at the moment.</p>

          <p>And as of very recently, it''s now the default in text-gen-ui.</p>

          <p>It''s 80% the same code as qwopqwop''s GPTQ-for-LLaMa, but much more
          organised and well designed.  qwopqwop is a developer on it, along with
          a guy called PanQiWei who started the project.  The "Auto" refers to the
          fact that it''s intended to be as easy to use as the Auto classes in transformers,
          eg instead of AutoModelForCausalLM you  use AutoGPTQForCausalLM, and then
          all the rest of your code works the same.</p>

          <p>If you update to latest text-gen-ui then AutoGPTQ is supported automatically.
          It detects the <code>quantize_config.json</code> file and loads it immediately.</p>

          '
